import './ExpenseItem.css';

const ExpenseItem = () => {
    return (
        <div className={'expense-item'}>
            <div>November 12th, Sat</div>
            <div className={'expense-item__description'}>
                <h2>Car Insurance</h2>
                <div className={'expense-item__price'}>$300</div>
            </div>
        </div>
    )
};

export default ExpenseItem;
